def findClumps(genome, k, windowLength, numInstances):
  genomeLength = len(genome)
  output = {}
  for windowIndex in range(genomeLength - windowLength):
    window = genome[windowIndex:windowIndex+windowLength]

    kdict = {}
    for kmerIndex in range(windowLength - k):
      tempKMer = window[kmerIndex:kmerIndex+k]
      kdict[tempKMer] = kdict.get(tempKMer, 0) + 1
    [output.setdefault(kmer) for kmer in kdict.keys() if kdict[kmer] == numInstances and kmer not in output]
  return output.keys()

